class StockSpanner:

    def __init__(self):
        self.stack = []

    # def next(self, price: int) -> int:
    #     idx = len(self.stack) - 1
    #     res = 1
    #     while self.stack and idx >=0 and self.stack[idx][0] <= price:
    #         res += self.stack[idx][1]
    #         idx -= self.stack[idx][1]
    #     self.stack.append([price, res])
    #     return res #len(self.stack) - idx - 1 
    
    def next(self, price: int) -> int:
        span = 1
        # Accumulate spans of prices <= current price
        while self.stack and self.stack[-1][0] <= price:
            span += self.stack.pop()[1]
        self.stack.append((price, span))
        return span





